import React from "react";

const PersonalInfoBar = () => {
  return (
    <div
      style={{
        backgroundColor: "#2E7D32",
        padding: "20px",
        color: "white",
        display: "flex",
        justifyContent: "space-between", // LOGO sol, buton sağ
        alignItems: "center",
        width: "100vw",
        margin: "0",
        boxSizing: "border-box"
      }}
    >
      {/* Sol: Logo */}
      <div style={{ display: "flex", alignItems: "center" }}>
        <img
        src="/images/istun_logo.png"
        alt="İstun Logo"
        style={{
            height: "40px",             // Bar yüksekliğine uygun sabit kalır
            marginLeft: "20px",
            transform: "scale(1.8)",    // Logoyu %30 büyütür
            transformOrigin: "left center"
        }}
        />

      </div>

      {/* Sağ: Giriş Yap Butonu */}
      <button
        style={{
          backgroundColor: "#fff",
          color: "black",
          padding: "10px 20px",
          borderRadius: "5px",
          border: "none",
          fontWeight: "bold",
          fontSize: "14px",
          marginRight: "70px",
          cursor: "pointer"
        }}
      >
        Giriş Yap
      </button>
    </div>
  );
};

export default PersonalInfoBar;
